import React from 'react';
import './App.css';
import Page2 from './Page2.js';
import { Router, Route } from 'react-router-dom';
import Login from './LogIn/Login.jsx';
function App() {
  return (
    <div className="App">
      <Router>
        <Route exact path="/" component={Login} />
        <Route exact path="/Page2" component={Page2} />
      </Router>
    </div>
  );
}

export default App;
